import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import QrReader from 'react-qr-scanner';
import './QrStyles.css';

const QRPDFApp = () => {
  const location = useLocation();
  const [spreadsheetId, setSpreadsheetId] = useState('');
  const [scannedUrl, setScannedUrl] = useState('');
  const [result, setResult] = useState(null);
  const [error, setError] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [isScanning, setIsScanning] = useState(true); // Start with scanning enabled

  useEffect(() => {
    // Extract spreadsheet ID from navigation state
    const state = location.state || {};
    setSpreadsheetId(state.spreadsheetId || '');
  }, [location]);

  useEffect(() => {
    setIsScanning(true);
    return () => {
      // Cleanup when component unmounts
      setIsScanning(false);
    };
  }, []);

  const handleScan = async (data) => {
    if (data?.text) {
      try {
        // Validate URL format
        new URL(data.text);
        setScannedUrl(data.text);
        setIsScanning(false);
        await processScannedUrl(data.text, spreadsheetId);
      } catch (err) {
        setError('Invalid QR code URL format');
      }
    }
  };

  const handleScanError = (err) => {
    console.error('QR Scan Error:', err);
    setError('Camera access error: ' + err.message);
    setIsScanning(false);
  };

  const processScannedUrl = async (url, spreadsheetId) => {
    const backendUrl = process.env.REACT_APP_BACKEND_URL || 'http://localhost:5000';
    
    setIsLoading(true);
    setError('');
    setResult(null);

    try {
      const response = await fetch(`${backendUrl}/register`, {
        method: 'POST',
        headers: { 
          'Content-Type': 'application/json'
        },
        credentials: 'include',
        body: JSON.stringify({ 
          scanned_url: url,
          scanned_at: new Date().toISOString(),
          spreadsheet_id: spreadsheetId
        }),
      });

      if (!response.ok) {
        const data = await response.json();
        throw new Error(data.error || `HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      
      if (!data.success) {
        throw new Error('Registration failed');
      }

      setResult(data.data);
    } catch (err) {
      setError('Error: ' + err.message);
      console.error('Processing Error:', err);
    } finally {
      setIsLoading(false);
    }
  };

  const restartScanning = () => {
    setIsScanning(true);
    setError('');
    setResult(null);
    setScannedUrl('');
  };

  return (
    <div className="scanner-container">
      <h2>QR Scanner</h2>
      
      {error && (
        <div className="error-message" role="alert">
          <p>{error}</p>
          <button onClick={() => setError('')}>Dismiss</button>
        </div>
      )}

      {/* Scanner is always shown unless there's a result or error */}
      {isScanning && !result && !error && (
        <div className="scanner-wrapper">
          <QrReader
            delay={300}
            onError={handleScanError}
            onScan={handleScan}
            constraints={{
              video: {
                facingMode: "environment",
                width: { ideal: 640 },
                height: { ideal: 480 }
              }
            }}
            className="qr-reader"
          />
        </div>
      )}

      {scannedUrl && (
        <div className="scan-result">
          <p><strong>Scanned URL:</strong> {scannedUrl}</p>
        </div>
      )}
      
      {isLoading && (
        <div className="loading-indicator">
          <p>Processing...</p>
        </div>
      )}

      {(result || error) && (
        <button 
          onClick={restartScanning}
          className="restart-button"
        >
          Scan Another Code
        </button>
      )}

      {result && (
        <div className="result-container">
          <h3>Registration Details:</h3>
          <div className="registration-details">
            <p><strong>Name:</strong> {result.Name}</p>
            <p><strong>Title:</strong> {result.Title}</p>
            <p><strong>Email:</strong> {result.Email}</p>
            <p><strong>Phone:</strong> {result.Phone}</p>
            <p><strong>Preferred Contact:</strong> {result.Preferred_Contact}</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default QRPDFApp;
